import './App.css';
import Footer from './components/Footer';
import Header from './components/Header';
import Logo from './components/Logo';

function App() {
  return (
    <div>
      <Logo />
      <Header />
      <Footer title='aaa' website='www.google.com' postcode={70110} />
    </div>
  );
}

export default App;
